CREATE TABLE IF NOT EXISTS ProyectoPOO.Apoderados (
    rut VARCHAR (10) NOT NULL,
    nombres VARCHAR (35) NOT NULL,
    apellido_paterno VARCHAR (25) NOT NULL,
    apellido_materno VARCHAR (25) NOT NULL,
    telefono INT,
    email VARCHAR (50),
    PRIMARY KEY (rut)
    ) ENGINE = InnoDB;

CREATE TABLE IF NOT EXISTS ProyectoPOO.Profesores (
    rut VARCHAR (10) NOT NULL,
    nombres VARCHAR (35) NOT NULL,
    apellido_paterno VARCHAR (25) NOT NULL,
    apellido_materno VARCHAR (25) NOT NULL,
    asignatura VARCHAR (35),
    email VARCHAR (50),
    telefono INT,
    PRIMARY KEY (rut)
    ) ENGINE = InnoDB;

CREATE TABLE IF NOT EXISTS ProyectoPOO.Cursos (
    nivel INT NOT NULL,
    paralelo CHAR NOT NULL,
    rut_profesor VARCHAR (10) NOT NULL,
    PRIMARY KEY (nivel, paralelo),
    FOREIGN KEY (rut_profesor) REFERENCES ProyectoPOO.Profesores (rut)
    ) ENGINE = InnoDB;

CREATE TABLE IF NOT EXISTS ProyectoPOO.Alumnos (
    nivel INT NOT NULL,
    paralelo CHAR NOT NULL,
    rut VARCHAR (10) NOT NULL,
    nombres VARCHAR (35) NOT NULL,
    apellido_paterno VARCHAR (25) NOT NULL,
    apellido_materno VARCHAR (25) NOT NULL,
    rut_apoderado VARCHAR (10) NOT NULL,
    PRIMARY KEY (rut),
    FOREIGN KEY (rut_apoderado) REFERENCES ProyectoPOO.Apoderados (rut),
    FOREIGN KEY (nivel, paralelo) REFERENCES ProyectoPOO.Cursos (nivel, paralelo)
    ) ENGINE = InnoDB;

CREATE TABLE IF NOT EXISTS ProyectoPOO.RegistroAsistencia (
    rut_alumno VARCHAR (10) NOT NULL,
    fecha DATE NOT NULL,
    valor FLOAT NOT NULL,
    presente BOOLEAN NOT NULL,
    justificado BOOLEAN NOT NULL,
    retiro BOOLEAN NOT NULL,
    PRIMARY KEY (rut_alumno, fecha),
    FOREIGN KEY (rut_alumno) REFERENCES ProyectoPOO.Alumnos (rut)
    ) ENGINE = InnoDB;





